import styled from "styled-components";

export const Container = styled.div`
  height: ${window.innerHeight}px;
  background: red;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
`;

export const Photo = styled.img`
  width: 150px;
  height: 150px;
  border-radius: 50%;
  background: #eee;
`;
